import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

// Redux
import store from "./app/store";
import { Provider } from "react-redux";

// Tailwind CSS
import "./tailwind.css";

ReactDOM.render(
  <React.StrictMode>
    <Provider store={store}>
      <App />
    </Provider>
  </React.StrictMode>,
  document.getElementById("root")
);
